import React from "react";
import css from "./Card.module.js";

export default function Card() {
  return (
    <div className={css.card}>
      <div className={css.title}>
        <h1>Cosas por hacer</h1>
      </div>
      <div className={css.description}>
        <p>
          Comprar media docena de medialunas, una factura con dulce de leche y
          hacer una pajita
        </p>
      </div>
      <div className={css.date}>21/3/2023</div>
    </div>
  );
}
